func (sus *ShipmentUSPSSelect) Aggregate(fns ...AggregateFunc) *ShipmentUSPSSelect {
	sus.fns = append(sus.fns, fns...)
	return sus
}

// Scan applies the selector query and scans the result into the given value.
func (sus *ShipmentUSPSSelect) Scan(ctx context.Context, v any) error {
	ctx = setContextOp(ctx, sus.ctx, ent.OpQuerySelect)
	if err := sus.prepareQuery(ctx); err != nil {
		return err
	}
	return scanWithInterceptors[*ShipmentUSPSQuery, *ShipmentUSPSSelect](ctx, sus.ShipmentUSPSQuery, sus, sus.inters, v)
}

func (sus *ShipmentUSPSSelect) sqlScan(ctx context.Context, root *ShipmentUSPSQuery, v any) error {
	selector := root.sqlQuery(ctx)
	aggregation := make([]string, 0, len(sus.fns))
	for _, fn := range sus.fns {
		aggregation = append(aggregation, fn(selector))
	}
	switch n := len(*sus.selector.flds); {
	case n == 0 && len(aggregation) > 0:
		selector.Select(aggregation...)
	case n != 0 && len(aggregation) > 0:
		selector.AppendSelect(aggregation...)
	}
	rows := &sql.Rows{}
	query, args := selector.Query()
	if err := sus.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}
